import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import Users from './components/Users';
import UserForm from './components/UserForm';
import Clients from './components/Clients';
import ClientForm from './components/ClientForm';
import ClientDetail from './components/ClientDetail';
import Deposits from './components/Deposits';
import DepositForm from './components/DepositForm';
import Withdrawals from './components/Withdrawals';
import WithdrawalForm from './components/WithdrawalForm';
import Layout from './components/Layout';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route
            path="/"
            element={
              <ProtectedRoute>
                <Layout>
                  <Dashboard />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/users"
            element={
              <ProtectedRoute>
                <Layout>
                  <Users />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/clients"
            element={
              <ProtectedRoute>
                <Layout>
                  <Clients />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/deposits"
            element={
              <ProtectedRoute>
                <Layout>
                  <Deposits />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/withdrawals"
            element={
              <ProtectedRoute>
                <Layout>
                  <Withdrawals />
                </Layout>
              </ProtectedRoute>
            }
          />
          {/* Form Routes */}
          <Route
            path="/users/new"
            element={
              <ProtectedRoute>
                <Layout>
                  <UserForm />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/users/:id/edit"
            element={
              <ProtectedRoute>
                <Layout>
                  <UserForm />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/clients/new"
            element={
              <ProtectedRoute>
                <Layout>
                  <ClientForm />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/clients/:id"
            element={
              <ProtectedRoute>
                <Layout>
                  <ClientDetail />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/clients/:id/edit"
            element={
              <ProtectedRoute>
                <Layout>
                  <ClientForm />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/deposits/new"
            element={
              <ProtectedRoute>
                <Layout>
                  <DepositForm />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/deposits/:id/edit"
            element={
              <ProtectedRoute>
                <Layout>
                  <DepositForm />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/withdrawals/new"
            element={
              <ProtectedRoute>
                <Layout>
                  <WithdrawalForm />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route
            path="/withdrawals/:id/edit"
            element={
              <ProtectedRoute>
                <Layout>
                  <WithdrawalForm />
                </Layout>
              </ProtectedRoute>
            }
          />
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
